import React from 'react';
import AlbumMaker from './AlbumMaker';

const Adventures = () => {
  return (
    <div>
        <div className="page-warmer">
            <img className="page-star" src="../images/skydive-moab.png" alt="../images/skydive-moab.png"/>
            <h1 className="header-text">I recently checked off skydiving, my next adventure will be in New Zealand.</h1>
          </div>
      <AlbumMaker/>
    </div>
  );
}

export default Adventures;
